                                //             </Label>
                                //         </Col>
                                //         <Col xl={10} xs={9} >
                                //             <p className="mb-0 font-small-3">{value.name}</p>
                                //         </Col>
                                //     </Row>
                                // </li>
                            })}
                        </ul>
                    </Col>

                </Row>


            </ModalBody>
            <ModalFooter>
                <Button color="primary" type="submit" onClick={handleClick}>
                    <Translate name="confirm"/>
                </Button>
            </ModalFooter>
        </React.Fragment>
    );

};

export default UserModal;
